import React from 'react'

export default function Basket({card}) {
  return (
    <div>
      {card.map(element => {
        return (
          <div key={element.id}>
            <div className='card-item'>
            <img src={element.image}/>
          <div className='card-item-info'>
            <h1>{element.title}</h1>
            <p>{element.price}</p>
          </div>
          <p>Total amount + {}</p>
            </div>
          </div>
        )
      })}
    </div>
  )
}
